import React, { useEffect, useState } from "react";
import "./SearchResult.css";
import ProductCard from "../../Component/ProductCard/ProductCard.js";
import { instanceAxs } from "../../config/api";
import { useLocation, useNavigate, useParams, useSearchParams } from "react-router-dom";
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Filters from "./Filters";
import Form from 'react-bootstrap/Form';
import Button from "react-bootstrap/Button";
import Badge from 'react-bootstrap/Badge';
import FilterBadge from "./FilterBadge";

const SearchResult = () => {

  const [productArray, setProductArray] = useState([]);
  const [searchParams, setSearchParams] = useSearchParams();  
  const [resultNumber, setResultNumber] = useState(0);

  const handleFilterChange = (key, value) => {
    const params = searchParams;
    if(key!== 'kommune') {
      params.delete(key);
    }
    params.append(key, value);
    setSearchParams(params)
  }

  const removeSelectedFilter = (key, value) => {
    const params = searchParams;
    if(key === 'fylke'){
      params.delete(key);
      params.delete('kommune')
    } else if(key === 'kommune') {
      let kommuneArr = [];
      for(const [queryKey, queryValue] of params.entries()){
        if(queryKey === 'kommune' && queryValue !== value) {
          kommuneArr.push(queryValue);
        }
      }
      params.delete('kommune');
      kommuneArr.map(item => {
        params.append('kommune', item)
      })
    }else {
      params.delete(key)
    }
    setSearchParams(params)
  }

  const handleSortingChange = (e) => {
    let value = e.target.value;
    var products = productArray;

    switch(value){
      case "price_desc":
        console.log(products)
      products[0].sort((a,b) => a.price - b.price);
      setProductArray(products);
      break;
      case "price_asc":
        console.log(value)

        let priceAscArray = [].concat(products)
        .sort((a, b) => a.price < b.price ? 1 : -1)
          setProductArray(priceAscArray)
        break;
    }
/*     if(value === "price_desc") {
      finalArray[0].sort((a, b) => a.price - b.price);

    } else if(value === "price_asc") {
      
    } else if(value === "published-last") {
      let publishArray = [].concat(finalArray)
    .sort((a, b) => a.date < b.date ? 1 : -1)
      finalArray = publishArray;
    } else if(value === "published-first") {
      let publishArray = [].concat(finalArray)
    .sort((a, b) => a.date > b.date ? 1 : -1)
      finalArray = publishArray;
    } */

    // setProductArray(finalArray)
  };

  const handleSorting = (e) => {
    let value = e.target.value;
    let products = productArray;
    let productPrices = [];

    products.map((row) => {
      row.map((item) => {
        productPrices.push(item)
      })
    })

    switch(value){
      case "price_asc":
        productPrices.sort((a,b) => a.price - b.price);
        break;
      case "price_desc":
      productPrices.sort((a,b) => b.price - a.price);
      break;
    }
    const rows = [...Array( Math.ceil(productPrices.length / 3))];
    const productRows = rows.map( (row, idx) => productPrices.slice(idx*3, idx * 3+ 3) );
    setProductArray(productRows)
  }

  const searchAlgorithm = () => {
    instanceAxs.post('/searchproduct', Object.fromEntries([...searchParams])).then((response) => {
        if (response.error !== null) {
          const products = response.data.productArray;

          const rows = [...Array( Math.ceil(products.length / 3))];
          const productRows = rows.map( (row, idx) => products.slice(idx*3, idx * 3+ 3) );
          setProductArray(productRows)
          setResultNumber(products.length)
          return;
        } 
        console.log(response.data.message)       
      })
      .catch((err) => {
        console.log(err);
      });
  }

  useEffect(() => {
    searchAlgorithm();
  }, [searchParams])

    return (
          <Container fluid className="searchresult-container">
            <Row  className="result-row">
                  <Col lg={3}  className="filters-column">
                        <Button variant="outline-danger" className="w-100 mb-4">Reset Filters</Button>
                        <Filters handleFilterChange={handleFilterChange} removeSelectedFilter={removeSelectedFilter} searchParams={searchParams}></Filters>
                  </Col>

                <Col className="products-column" lg={8}>

                    <div className="top-row">
                      <p>{productArray.length} treff</p>
                      <Form.Select style={{maxWidth: 200}} onChange={handleSorting}>
                        <option value="mest-relevant">Mest Relevant</option>
                        <option value="puslished-first">Eldste først</option>
                        <option value="published-last">Nyeste først</option>
                        <option value="price_asc">Pris lav til høy</option>
                        <option value="price_desc">Pris høy til lav</option>
                      </Form.Select>
                    </div>

                    <div className="middle-row">
                        <FilterBadge searchParams={searchParams} removeSelectedFilter={removeSelectedFilter}></FilterBadge>
                    </div>

                      <div className="bottom-row">
                      {productArray.length > 0 && productArray.map((row, index) => {
                    return(             
                        <Row key={index} className="product-row">
                        {row.map((product, index) => {
                            return(
                                    <div key={index}  className="product-column">
                                        <ProductCard
                                        
                                        key={product.title}
                                        images={product.annonceImages}
                                        title={product.title}
                                        price={product.price}
                                        id={product._id}
                                        location={product.location}
                                        ></ProductCard>
                                </div>
                            )
                        })}
                    </Row>                 
                    )
                })               
                }
          
                      </div>
                  </Col>
            </Row>
          </Container>
    );
  
}

export default SearchResult;
